    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/5.15.3/css/all.min.css">
    <style>
        a {
            font-family: Arial, sans-serif;
            color: #007bff;
        }

        body {
            background-color: #222;
            color: #fff;
            font-family: Arial, sans-serif;
            margin: 0;
            padding: 0;
        }

        .container {
            max-width: 500px;
            margin: 0 auto;
            padding: 20px;
            align-items: center;
            display: flex;
            flex-direction: column;
        }

        .h1 {
            text-align: center;
            text-transform: uppercase;
            margin-bottom: 20px;
        }

        .server-details {
            background-color: #333;
            padding: 20px;
            border-radius: 10px;
            margin-top: 20px;
            overflow-wrap: break-word;
            animation: fadeIn 1s ease-out;
            position: relative;
            overflow: auto;
        }

        .server-details p {
            margin: 0;
        }

        .container input[type="number"] {
            width: 100%;
            padding: 10px;
            border: none;
            border-radius: 5px;
            margin-top: 10px;
            background-color: #353535;
            color: #fff;
        }

        input[type=number] {
            -moz-appearance: textfield;
        }

        input::-webkit-outer-spin-button,
        input::-webkit-inner-spin-button {
            -webkit-appearance: none;
            margin: 0;
        }

        .container input[type="text"] {
            width: 100%;
            padding: 10px;
            border: none;
            border-radius: 5px;
            margin-top: 10px;
            background-color: #444;
            color: #fff;
        }

        .container button {
            display: block;
            margin-top: 10px;
            padding: 10px;
            background-color: #007bff;
            color: #fff;
            border: none;
            border-radius: 5px;
            cursor: pointer;
        }

        @media (max-width:768px) {
            .container {
                max-width: 100%;
                padding: 10px;
            }

            .server-details {
                padding: 10px;
                margin-top: 10px;
            }
        }

        footer {
            padding: 20px;
            text-align: center;
            font-size: 14px;
            margin-top: 20px;
            border-radius: 10px;
        }

        .profile-heading {
            display: flex;
            align-items: center;
            margin-bottom: 20px;
        }

        .profile-pic {
            width: 100px;
            height: 100px;
            border-radius: 50%;
            object-fit: cover;
            object-position: center;
            transition: transform 0.5s ease;
            margin-right: 10px;
        }

        .profile-pic:hover {
            transform: scale(1.2);
        }
    </style>
</head>
